import { useEffect, useState } from "react";
import Header from "./Header";
import {USER_API_URL,FLAT_API_URL} from './AppConst';
import {fetchPost,fetchGet,getUserId, fetchDelete} from './AppService';
function Home(){
  const [flatList,setFlatList] = useState([]);
  const [myBookList,setMyBookList] = useState([]);
  const [flatSearchList,setFlatSearchList] = useState([]);
  const [email,setEmail] = useState('');
  const [pwd,setPwd] = useState('');
  const [re_pwd,setRe_Pwd] = useState('');
  const [pageError,setPageError]=useState({});
  const [name,setName] = useState('');

  const [pincode,setPincode] = useState('');
  const [searchType,setSearchType] = useState('');
  const [searchVal,setSearchVal] = useState('');
  const [pageType,setPageType]=useState('search');

  const clearSearch=()=>{
    setSearchVal('');
    setSearchType('');
    searchFlat();
  }
  const loginValidation=()=>{
    let status = false;
    let error = {};
    if(email == ""){
      status = true;
      error.email = true;
    }
    if(name == ""){
      status = true;
      error.name = true;
    }
    setPageError(error);
    return status;
  }
  const userUpdaetDetails=()=>{
    if(loginValidation()){
      return;
    }
    let param = {
      "id":getUserId(),
      'name':name,
      'email':email
    }
    fetchPut(USER_API_URL+"user/updateUserById",param)
    .then(res=>{
      alert("User details updated!");
    }).catch(err=>{
      err.then(er=>{
        alert(er['message']);
        //console.log(er);
      })    });
  }
  const updatePassword=()=>{
    let status = false;
    let error = {};
    if(pwd == ""){
      status = true;
      error.pwd = true;
    }if(re_pwd == ""){
      status = true;
      error.re_pwd = true;
    }if(re_pwd != pwd){
      status = true;
      error.pwd_same = true;
    }
    setPageError(error);
    if(status){
      //due to error flow ll stop here,
      return;
    }

    let param = {
      "id":getUserId(),
      'password':pwd
    }
    fetchPost(USER_API_URL+"user/updatePassword",param)
    .then(res=>{
      alert("updated");
    }).catch(err=>{
      err.then(er=>{
        alert(er['message']);
        //console.log(er);
      })    });
  }
  const changePageType=(type)=>{
    setPageType(type);
  }
  const searchFlat2=()=>{
    if(searchType == "" || searchVal == ""){
      alert("Please enter value and type.");
      return;
    }
    let flatListtmp = [];
    if(searchType == "rent"){
      flatListtmp = flatSearchList.filter(o=>o[searchType] > searchVal);
    }else{
      console.log(searchType+"--"+searchVal);
      flatListtmp = flatSearchList.filter(o=>o[searchType] == searchVal);
    }

    setFlatList(flatListtmp);
  }
  const searchFlat=()=>{

    //rent bhk pincode
    let param = {
      'searchType':searchType,
      'searchValue':searchVal
    }
    fetchPost(FLAT_API_URL+"flat/search",param)
    .then(res=>{
      let user_id = getUserId();
      let res_tmp = res.filter(o=>o.isApproved==1);
      let myBookTmp  = res.filter(o=>o.bookModel?.user_id==user_id);
      console.log(res_tmp)
      setFlatList(res_tmp);
      setFlatSearchList(res_tmp);
      setMyBookList(myBookTmp);
    });
  }
  const cancelBook=(book)=>{

    if(!window.confirm("Do you want to cancel this booking?")){
      return;
    }

    fetchDelete(FLAT_API_URL+"flat/booking/delete/"+book.bookModel.id)
    .then(res=>{
      alert("Flat booking cancelled!");
      searchFlat();//refresh flat
      //setFlatList(res);
    }).catch(err=>{
      err.then(er=>{
        alert(er['message']);
        //console.log(er);
      })
    }) 
